INSERT INTO `oc_modification` (`modification_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES
(2, 'Product Option Image', 'Product Option Image', 'Extensions Bazaar', '2.0', '', '<?xml version="1.0" encoding="UTF-8"?>\r\n<modification>\r\n	<name>Product Option Image</name>\r\n	<version>2.0</version>\r\n	<code>Product Option Image</code>\r\n	<author>Extensions Bazaar</author>\r\n	<file path="admin/language/*/catalog/product.php">\r\n		<operation>\r\n			<search><![CDATA[// Text]]></search>\r\n			<add position="after"><![CDATA[\r\n				$_[''tab_option_image'']       = ''Option Images'';\r\n				$_[''entry_option_image'']     = ''Option Images'';\r\n				]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="admin/controller/catalog/product.php">\r\n		<operation>\r\n			<search><![CDATA[$this->load->model(''customer/customer_group'');]]></search>\r\n			<add position="after"><![CDATA[\r\n				$data[''tab_option_image''] = $this->language->get(''tab_option_image'');\r\n				$data[''entry_option_image''] = $this->language->get(''entry_option_image'');\r\n					$this->load->model(''tool/image'');\r\n		$data[''optionrealtedoptions'']=array();\r\n		$data[''optionimagepermisions'']=false;\r\n		if(isset($this->request->get[''product_id''])){\r\n			$data[''optionimagepermisions'']=true;\r\n			$data[''optionrealtedoptions''] = $this->model_catalog_product->getoptionrealtedoption($this->request->get[''product_id'']);\r\n			if(isset($this->request->post[''product_option_image''])){\r\n				$optionimages = $this->request->post[''product_option_image''];\r\n			}else{\r\n				$optionimages = $this->model_catalog_product->getoptionimages($this->request->get[''product_id'']);\r\n			}\r\n			\r\n			$data[''product_option_images'']=array();\r\n			foreach($optionimages as $optionimage){\r\n				if (is_file(DIR_IMAGE . $optionimage[''image''])){\r\n					$opimage = $optionimage[''image''];\r\n					$opthumb = $optionimage[''image''];\r\n				} else {\r\n					$opimage = '''';\r\n					$opthumb = ''no_image.png'';\r\n				}\r\n				$data[''product_option_images''][]=array(\r\n					''image'' 								=> $opimage,\r\n					''thumb''     						=> $this->model_tool_image->resize($opthumb, 100, 100),\r\n					''sort_order'' 						=> $optionimage[''sort_order''],\r\n					''product_option_value''  => $optionimage[''product_option_value'']\r\n				);\r\n			}\r\n		}\r\n				]]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[$this->load->model(''catalog/option'');]]></search>\r\n			<add position="after"><![CDATA[\r\n				$this->load->model(''tool/image'');\r\n				]]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[$product_option_value_data[] = array(]]></search>\r\n			<add position="before"><![CDATA[\r\n				if($product_option_value[''image'']){\r\n						$thumb = $this->model_tool_image->resize($product_option_value[''image''],100,100);\r\n					}else{\r\n						$thumb = $this->model_tool_image->resize(''no_image.png'',100,100);\r\n					}\r\n				]]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[''weight''                  => $product_option_value[''weight''],]]></search>\r\n			<add position="after"><![CDATA[\r\n				''image''           				=> $product_option_value[''image''],\r\n				''thumb''           				=> $thumb,\r\n				]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="admin/view/template/catalog/product_form.tpl">\r\n		<operation>\r\n			<search><![CDATA[<li><a href="#tab-option" data-toggle="tab"><?php echo $tab_option; ?></a></li>]]></search>\r\n			<add position="after"><![CDATA[\r\n				<?php if($optionimagepermisions){ ?>\r\n				<li><a href="#tab-option-image" data-toggle="tab"><?php echo $tab_option_image; ?></a></li>\r\n				<?php } ?>\r\n				]]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[<div class="tab-pane" id="tab-option">]]></search>\r\n			<add position="before"><![CDATA[\r\n				<div class="tab-pane" id="tab-option-image">\r\n							<div class="table-responsive">\r\n                <table id="optionimage" class="table table-striped table-bordered table-hover">\r\n                  <thead>\r\n                    <tr>\r\n                      <td class="text-left"><?php echo $entry_option_image; ?></td>\r\n                      <td class="text-right"><?php echo $entry_option; ?></td>\r\n                      <td class="text-right"><?php echo $entry_sort_order; ?></td>\r\n                      <td></td>\r\n                    </tr>\r\n                  </thead>\r\n									<tbody>\r\n									<?php $option_image_row = 0; ?>\r\n										<?php foreach($product_option_images as $optionimage){ ?>\r\n											<tr id="optionimage-row<?php echo $option_image_row; ?>">\r\n												<td class="text-left"><a href="" id="thumb-image<?php echo $option_image_row; ?>" data-toggle="image" class="img-thumbnail"><img src="<?php echo $optionimage[''thumb'']; ?>" alt="" title="" data-placeholder="<?php echo $placeholder; ?>" /></a><input type="hidden" name="product_option_image[<?php echo $option_image_row; ?>][image]" value="<?php echo $optionimage[''image'']; ?>" id="input-optionimage<?php echo $option_image_row; ?>" /></td>\r\n												<td class="text-left">\r\n													<?php foreach($optionrealtedoptions as $product_option){ ?>\r\n														<b><?php echo $product_option[''name'']; ?></b> <br/>\r\n														<?php foreach($product_option[''product_option_value''] as $product_option_value){\r\n																if(isset($optionimage[''product_option_value'']) && in_array($product_option_value[''product_option_value_id''],$optionimage[''product_option_value''])){\r\n																	$select = "checked=checked";\r\n																}else{\r\n																	$select = '''';\r\n																}\r\n														?>\r\n																<label><input <?php echo $select; ?> type="checkbox" name="product_option_image[<?php echo $option_image_row; ?>][product_option_value][]" value="<?php echo $product_option_value[''product_option_value_id'']; ?>"/> <?php echo $product_option_value[''name'']; ?></label><br/>\r\n														<?php } ?>\r\n													<?php } ?>\r\n												</td>\r\n												<td class="text-right"><input type="text" name="product_option_image[<?php echo $option_image_row; ?>][sort_order]" value="<?php echo $optionimage[''sort_order'']; ?>" placeholder="<?php echo $entry_sort_order; ?>" class="form-control" /></td>\r\n												<td class="text-left"><button type="button" onclick="$(''#optionimage-row<?php echo $option_image_row; ?>'').remove();" data-toggle="tooltip" title="<?php echo $button_remove; ?>" class="btn btn-danger"><i class="fa fa-minus-circle"></i></button></td>\r\n                    </tr>\r\n										<?php $option_image_row++; } ?>\r\n									</tbody>\r\n									<tfoot>\r\n                    <tr>\r\n                      <td colspan="3"></td>\r\n                      <td class="text-left"><button type="button" onclick="addoptionImage();" data-toggle="tooltip" title="<?php echo $button_image_add; ?>" class="btn btn-primary"><i class="fa fa-plus-circle"></i></button></td>\r\n                    </tr>\r\n                  </tfoot>\r\n                </table>\r\n              </div>\r\n						</div>\r\n				]]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[<?php echo $footer; ?>]]></search>\r\n			<add position="before"><![CDATA[\r\n				 <script type="text/javascript"><!--\r\nvar option_image_row = <?php echo $option_image_row; ?>;\r\n\r\nfunction addoptionImage() {\r\n	html  = ''<tr id="optionimage-row'' + option_image_row + ''">'';\r\n	html += ''  <td class="text-left"><a href="" id="thumb-image'' + option_image_row + ''"data-toggle="image" class="img-thumbnail"><img src="<?php echo $placeholder; ?>" alt="" title="" data-placeholder="<?php echo $placeholder; ?>" /></a><input type="hidden" name="product_option_image['' + option_image_row + ''][image]" value="" id="input-optionimage'' + option_image_row + ''" /></td>'';\r\n	html +=''<td class="text-left">'';\r\n	<?php foreach($optionrealtedoptions as $product_option){ ?>\r\n		html +=''<b><?php echo $product_option[''name'']; ?></b> <br/>'';\r\n		<?php foreach($product_option[''product_option_value''] as $product_option_value){ ?>\r\n				html +=''<label><input type="checkbox" name="product_option_image[''+ option_image_row  +''][product_option_value][]" value="<?php echo $product_option_value[''product_option_value_id'']; ?>"/> <?php echo $product_option_value[''name'']; ?></label><br/>'';\r\n		<?php } ?>\r\n	<?php } ?>\r\n	html +=''</td>'';\r\n	html += ''  <td class="text-right"><input type="text" name="product_option_image['' + option_image_row + ''][sort_order]" value="" placeholder="<?php echo $entry_sort_order; ?>" class="form-control" /></td>'';\r\n	html += ''  <td class="text-left"><button type="button" onclick="$(\\''#optionimage-row'' + option_image_row  + ''\\'').remove();" data-toggle="tooltip" title="<?php echo $button_remove; ?>" class="btn btn-danger"><i class="fa fa-minus-circle"></i></button></td>'';\r\n	html += ''</tr>'';\r\n\r\n	$(''#optionimage tbody'').append(html);\r\n\r\n	option_image_row++;\r\n}\r\n//--></script>\r\n				]]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[value="<?php echo $product_option_value[''weight'']; ?>" placeholder="<?php echo $entry_weight; ?>" class="form-control" /></td>]]></search>\r\n			<add position="after"><![CDATA[\r\n				<td class="text-center"><a href="" id="thumb-image-<?php echo $option_row; ?><?php echo $option_value_row; ?>" data-toggle="image" class="img-thumbnail"><img src="<?php echo $product_option_value[''thumb'']; ?>" alt="" title="" data-placeholder="<?php echo $placeholder; ?>" /></a><input type="hidden" name="product_option[<?php echo $option_row; ?>][product_option_value][<?php echo $option_value_row; ?>][image]" value="<?php echo $product_option_value[''image'']; ?>" id="input-image<?php echo $option_row; ?><?php echo $option_value_row; ?>" />\r\n															</td>\r\n				]]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[placeholder="<?php echo $entry_weight; ?>" class="form-control" /></td>'';]]></search>\r\n			<add position="after"><![CDATA[\r\n				html += ''<td class="text-center"><a href="" id="thumb-image'' + option_row + option_value_row +''" data-toggle="image" class="img-thumbnail"><img src="<?php echo $placeholder; ?>" alt="" title="" data-placeholder="<?php echo $placeholder; ?>" /></a><input type="hidden" name="product_option['' + option_row + ''][product_option_value]['' + option_value_row + ''][image]"  id="input-image'' + option_row +option_value_row+ ''" value="" /></td>'';\r\n			]]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[<td class="text-right"><?php echo $entry_weight; ?></td>'';]]></search>\r\n			<add position="after"><![CDATA[\r\n				html += '' <td class="text-right"><?php echo $entry_image; ?></td>'';\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="admin/model/catalog/product.php">\r\n		<operation>\r\n			<search><![CDATA[public function addProduct($data) {]]></search>\r\n			<add position="before"><![CDATA[\r\n				public function alterquery(){\r\n					$query = $this->db->query("SHOW COLUMNS FROM `" . DB_PREFIX . "product_option_value` LIKE ''image''");\r\n					if(!$query->num_rows){\r\n						$this->db->query("ALTER TABLE `" . DB_PREFIX . "product_option_value` ADD `image` varchar(255) NOT NULL AFTER `weight_prefix`");\r\n					}\r\n					\r\n					$this->db->query("CREATE TABLE IF NOT EXISTS `".DB_PREFIX."product_option_image` (`product_option_image_id` int(11) NOT NULL AUTO_INCREMENT,`product_id` int(11) NOT NULL,`image` varchar(255) CHARACTER SET utf8 NOT NULL,`sort_order` int(11) NOT NULL,`status` int(11) NOT NULL,PRIMARY KEY (`product_option_image_id`))");\r\n	\r\n					$this->db->query("CREATE TABLE IF NOT EXISTS `".DB_PREFIX."product_option_image_value` (`oc_product_option_image_value_id` int(11) NOT NULL AUTO_INCREMENT,`product_option_image_id` int(11) NOT NULL,`product_option_value_id` int(11) NOT NULL,`product_id` int(11) NOT NULL,PRIMARY KEY (`oc_product_option_image_value_id`))");\r\n					\r\n				}\r\n				\r\n				public function getoptionrealtedoption($product_id) {\r\n		$product_option_data = array();\r\n\r\n		$product_option_query = $this->db->query("SELECT * FROM " . DB_PREFIX . "product_option po LEFT JOIN `" . DB_PREFIX . "option` o ON (po.option_id = o.option_id) LEFT JOIN " . DB_PREFIX . "option_description od ON (o.option_id = od.option_id) WHERE po.product_id = ''" . (int)$product_id . "'' AND od.language_id = ''" . (int)$this->config->get(''config_language_id'') . "'' ORDER BY o.sort_order");\r\n\r\n		foreach ($product_option_query->rows as $product_option) {\r\n			$product_option_value_data = array();\r\n			\r\n			$product_option_value_query = $this->db->query("SELECT pov.*,ovd.*,ov.* FROM " . DB_PREFIX . "product_option_value pov LEFT JOIN " . DB_PREFIX . "option_value ov ON (pov.option_value_id = ov.option_value_id) LEFT JOIN " . DB_PREFIX . "option_value_description ovd ON (ov.option_value_id = ovd.option_value_id) WHERE pov.product_id = ''" . (int)$product_id . "'' AND pov.product_option_id = ''" . (int)$product_option[''product_option_id''] . "'' AND ovd.language_id = ''" . (int)$this->config->get(''config_language_id'') . "'' ORDER BY ov.sort_order");\r\n\r\n			foreach ($product_option_value_query->rows as $product_option_value) {\r\n				$product_option_value_data[] = array(\r\n					''product_option_value_id'' => $product_option_value[''product_option_value_id''],\r\n					''option_value_id''         => $product_option_value[''option_value_id''],\r\n					''name''                    => $product_option_value[''name''],\r\n				);\r\n			}\r\n			\r\n			if ($product_option[''type''] == ''select'' || $product_option[''type''] == ''radio'' || $product_option[''type''] == ''checkbox'' || $product_option[''type''] == ''image'') {\r\n				$product_option_data[] = array(\r\n					''product_option_id''    => $product_option[''product_option_id''],\r\n					''product_option_value'' => $product_option_value_data,\r\n					''option_id''            => $product_option[''option_id''],\r\n					''name''                 => $product_option[''name''],\r\n				);\r\n			}\r\n		}\r\n		return $product_option_data;\r\n	}\r\n		\r\n	public function getoptionimages($product_id){\r\n		$optionimages=array();\r\n		$query = $this->db->query("SELECT * FROM ".DB_PREFIX."product_option_image WHERE product_id = ".(int)$product_id."");\r\n		foreach($query->rows as $row){\r\n			$product_option_value_query = $this->db->query("SELECT * FROM ".DB_PREFIX."product_option_image_value WHERE product_option_image_id = ".(int)$row[''product_option_image_id'']."");\r\n			$product_option_value_data=array();\r\n			foreach($product_option_value_query->rows as $product_option_value){\r\n				$product_option_value_data[] = $product_option_value[''product_option_value_id''];\r\n			}\r\n			$optionimages[]=array(\r\n				''image''									=> $row[''image''],\r\n				''sort_order''						=> $row[''sort_order''],\r\n				''product_option_value''	=> $product_option_value_data,\r\n			);\r\n		}\r\n		return $optionimages;\r\n	}\r\n			]]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[public function editProduct($product_id, $data) {]]></search>\r\n			<add position="after"><![CDATA[\r\n		$this->db->query("DELETE FROM ".DB_PREFIX."product_option_image WHERE product_id = ''".(int)$product_id."''");\r\n		$this->db->query("DELETE FROM ".DB_PREFIX."product_option_image_value WHERE product_id = ''".(int)$product_id."''");\r\n		if(isset($data[''product_option_image''])){\r\n			foreach($data[''product_option_image''] as $product_option_image){\r\n				\r\n				$this->db->query("INSERT INTO ".DB_PREFIX."product_option_image SET product_id = ''".(int)$product_id."'',image = ''".$product_option_image[''image'']."'',sort_order = ''".(int)$product_option_image[''sort_order'']."''");	\r\n				\r\n				$product_option_image_id = $this->db->getLastId();\r\n				\r\n				foreach($product_option_image[''product_option_value''] as $product_option_value_id){\r\n					$this->db->query("INSERT INTO ".DB_PREFIX."product_option_image_value SET product_id = ''".(int)$product_id."'', product_option_value_id = ''".(int)$product_option_value_id."'',product_option_image_id=''".(int)$product_option_image_id."''");	\r\n				}\r\n			}\r\n		}\r\n			]]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[public function getTotalProducts($data = array()) {]]></search>\r\n			<add position="after"><![CDATA[\r\n				$this->alterquery();\r\n			]]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[weight_prefix = ''" . $this->db->escape($product_option_value[''weight_prefix'']) . "'']]></search>\r\n			<add position="replace"><![CDATA[weight_prefix = ''" . $this->db->escape($product_option_value[''weight_prefix'']) . "'',image = ''" . $this->db->escape($product_option_value[''image'']) . "'']]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[''weight''                  => $product_option_value[''weight''],]]></search>\r\n			<add position="after"><![CDATA[''image''           				=> $product_option_value[''image''],]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="admin/model/catalog/product.php">\r\n		<operation>\r\n			<search><![CDATA[SELECT * FROM " . DB_PREFIX . "product_option_value]]></search>\r\n			<add position="replace"><![CDATA[SELECT pov.* FROM " . DB_PREFIX . "product_option_value]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="catalog/controller/product/product.php">\r\n		<operation>\r\n			<search><![CDATA[$data[''options''] = array();]]></search>\r\n			<add position="after"><![CDATA[\r\n			$productoptionsimages=array();\r\n			foreach ($this->model_catalog_product->getproductoptionimages($this->request->get[''product_id'']) as $optionimg){\r\n				if($optionimg){\r\n					if(VERSION >= ''2.2.0.0''){\r\n						if($optionimg[''image'']){\r\n							$popup = $this->model_tool_image->resize($optionimg[''image''], $this->config->get($this->config->get(''config_theme'') . ''_image_popup_width''), $this->config->get($this->config->get(''config_theme'') . ''_image_popup_height''));\r\n						} else {\r\n							$popup = '''';\r\n						}\r\n					}else{\r\n						if($optionimg[''image'']){\r\n							$popup = $this->model_tool_image->resize($optionimg[''image''], $this->config->get(''config_image_popup_width''), $this->config->get(''config_image_popup_height''));\r\n						} else {\r\n							$popup = '''';\r\n						}\r\n					}\r\n					if(VERSION >= ''2.2.0.0''){\r\n						if ($optionimg[''image'']) {\r\n							$thumb = $this->model_tool_image->resize($optionimg[''image''], $this->config->get($this->config->get(''config_theme'') . ''_image_thumb_width''), $this->config->get($this->config->get(''config_theme'') . ''_image_thumb_height''));\r\n						} else {\r\n							$thumb = '''';\r\n						}\r\n					}else{\r\n						if ($optionimg[''image'']) {\r\n							$thumb = $this->model_tool_image->resize($optionimg[''image''], $this->config->get(''config_image_thumb_width''), $this->config->get(''config_image_thumb_height''));\r\n						} else {\r\n							$thumb = '''';\r\n						}\r\n					}\r\n					\r\n					$productoptionsimages[$optionimg[''product_option_value_id'']]=array(\r\n						''thumb''										=> $thumb,\r\n						''popup''										=> $popup,\r\n					);\r\n				}\r\n			}\r\n		\r\n				$data[''productoptionsimages''] = json_encode($productoptionsimages);\r\n				\r\n				$additional_optionsubimages=array();\r\n			foreach($this->model_catalog_product->getProductsubimages($this->request->get[''product_id'']) as $opimages){\r\n				if($opimages[''image'']){\r\n					if(VERSION >= ''2.2.0.0''){\r\n						$popup = $this->model_tool_image->resize($opimages[''image''], $this->config->get($this->config->get(''config_theme'') . ''_image_popup_width''), $this->config->get($this->config->get(''config_theme'') . ''_image_popup_height''));\r\n						\r\n						$thumb = $this->model_tool_image->resize($opimages[''image''], $this->config->get($this->config->get(''config_theme'') . ''_image_additional_width''), $this->config->get($this->config->get(''config_theme'') . ''_image_additional_height''));\r\n					}else{\r\n						$popup = $this->model_tool_image->resize($opimages[''image''], $this->config->get(''config_image_popup_width''), $this->config->get(''config_image_popup_height''));	\r\n						\r\n						$thumb = $this->model_tool_image->resize($opimages[''image''], $this->config->get(''config_image_additional_width''), $this->config->get(''config_image_additional_height''));\r\n					}\r\n				}\r\n				\r\n				$additional_optionsubimages[$opimages[''product_option_value_id'']][]=array(\r\n					''popup''	=> $popup,\r\n					''thumb''	=> $thumb,\r\n					''product_option_value_id''			=> $opimages[''product_option_value_id'']\r\n				);\r\n			}\r\n			\r\n			$data[''additionaloptionsubimages''] = json_encode($additional_optionsubimages);\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="catalog/view/theme/*/template/product/product.tpl">\r\n		<operation>\r\n			<search><![CDATA[<?php echo $footer; ?>]]></search>\r\n			<add position="before"><![CDATA[\r\n								<script type="text/javascript"><!--\r\n		$(''#product input[type="radio"]'').click(function(){\r\n		selectvalue($(this).val());\r\n	});\r\n	$(''#product input[type="checkbox"]'').click(function(){\r\n		selectvalue($(this).val());\r\n	});\r\n	$(''#product select'').change(function(){\r\n		selectvalue($(this).val());\r\n	});\r\n	function selectvalue(product_option_id){\r\n		$.each(<?php echo $productoptionsimages ?>, function( index, value){\r\n			if(product_option_id==index){\r\n				html = '''';\r\n				if(value[''thumb'']){\r\n					html +=''<li><a class="thumbnail" href="''+ value[''popup''] +''" title="<?php echo $heading_title; ?>"><img src="''+ value[''thumb''] +''" title="<?php echo $heading_title; ?>" alt="<?php echo $heading_title; ?>"/></a></li>'';\r\n				}\r\n			}\r\n		});	\r\n		\r\n		addhtml='''';\r\n		var additionaloptionsubimages	= <?php echo $additionaloptionsubimages ?>;\r\n		if(additionaloptionsubimages[product_option_id]){\r\n			$.each(additionaloptionsubimages[product_option_id], function(key, value1){\r\n				addhtml += ''<li class="image-additional"><a class="thumbnail" href="''+ value1[''popup''] +''" title="<?php echo $heading_title; ?>"> <img src="''+ value1[''thumb''] +''" title="<?php echo $heading_title; ?>" alt="<?php echo $heading_title; ?>" /></a></li>'';\r\n			});\r\n		}\r\n		\r\n		if(html==''''){\r\n			html +=''<li><a class="thumbnail" href="<?php echo $popup; ?>" title="<?php echo $heading_title; ?>"><img src="<?php echo $thumb; ?>" title="<?php echo $heading_title; ?>" alt="<?php echo $heading_title; ?>" /></a></li>'';\r\n		}\r\n		\r\n		if(addhtml==''''){\r\n        <?php foreach($images as $image){ ?>\r\n      addhtml += ''<li class="image-additional"><a class="thumbnail" href="<?php echo $image[''popup'']; ?>" title="<?php echo $heading_title; ?>"> <img src="<?php echo $image[''thumb'']; ?>" title="<?php echo $heading_title; ?>" alt="<?php echo $heading_title; ?>" /></a></li>'';\r\n        <?php } ?>\r\n		}\r\n		\r\n		$(''.thumbnails'').html(html + addhtml);\r\n	}\r\n//--></script>\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n	<file path="catalog/model/catalog/product.php">\r\n		<operation>\r\n			<search><![CDATA[SELECT * FROM " . DB_PREFIX . "product_option_value pov]]></search>\r\n			<add position="replace"><![CDATA[SELECT pov.*,ovd.name  FROM " . DB_PREFIX . "product_option_value pov]]></add>\r\n		</operation>\r\n		<operation>\r\n			<search><![CDATA[public function getProductOptions($product_id) {]]></search>\r\n			<add position="before"><![CDATA[\r\n			public function alterquery(){\r\n					$query = $this->db->query("SHOW COLUMNS FROM `" . DB_PREFIX . "product_option_value` LIKE ''image''");\r\n					if(!$query->num_rows){\r\n						$this->db->query("ALTER TABLE `" . DB_PREFIX . "product_option_value` ADD `image` varchar(255) NOT NULL AFTER `weight_prefix`");\r\n					}\r\n					\r\n					$this->db->query("CREATE TABLE IF NOT EXISTS `".DB_PREFIX."product_option_image` (`product_option_image_id` int(11) NOT NULL AUTO_INCREMENT,`product_id` int(11) NOT NULL,`image` varchar(255) CHARACTER SET utf8 NOT NULL,`sort_order` int(11) NOT NULL,`status` int(11) NOT NULL,PRIMARY KEY (`product_option_image_id`))");\r\n	\r\n					$this->db->query("CREATE TABLE IF NOT EXISTS `".DB_PREFIX."product_option_image_value` (`oc_product_option_image_value_id` int(11) NOT NULL AUTO_INCREMENT,`product_option_image_id` int(11) NOT NULL,`product_option_value_id` int(11) NOT NULL,`product_id` int(11) NOT NULL,PRIMARY KEY (`oc_product_option_image_value_id`))");\r\n			}\r\n				\r\n				public function getproductoptionimages($product_id){\r\n				$this->alterquery();\r\n		$product_option_data = array();\r\n\r\n		$product_option_query = $this->db->query("SELECT * FROM " . DB_PREFIX . "product_option po LEFT JOIN `" . DB_PREFIX . "option` o ON (po.option_id = o.option_id) LEFT JOIN " . DB_PREFIX . "option_description od ON (o.option_id = od.option_id) WHERE po.product_id = ''" . (int)$product_id . "'' AND od.language_id = ''" . (int)$this->config->get(''config_language_id'') . "'' ORDER BY o.sort_order");\r\n		$product_option_value_data = array();\r\n		foreach($product_option_query->rows as $product_option){\r\n			$product_option_value_query = $this->db->query("SELECT pov.image,pov.product_option_value_id  FROM " . DB_PREFIX . "product_option_value pov LEFT JOIN " . DB_PREFIX . "option_value ov ON (pov.option_value_id = ov.option_value_id) LEFT JOIN " . DB_PREFIX . "option_value_description ovd ON (ov.option_value_id = ovd.option_value_id) WHERE pov.product_id = ''" . (int)$product_id . "'' AND pov.product_option_id = ''" . (int)$product_option[''product_option_id''] . "'' AND ovd.language_id = ''" . (int)$this->config->get(''config_language_id'') . "'' ORDER BY ov.sort_order");\r\n\r\n			foreach ($product_option_value_query->rows as $product_option_value) {\r\n				$product_option_value_data[] = array(\r\n					''product_option_value_id'' => $product_option_value[''product_option_value_id''],\r\n					''image''                   => $product_option_value[''image''],\r\n				);\r\n			}\r\n		}\r\n\r\n		return $product_option_value_data;\r\n	}\r\n	\r\n	public function getProductsubimages($product_id){\r\n		return $this->db->query("SELECT poiv.product_option_value_id,poi.image FROM ".DB_PREFIX."product_option_image poi LEFT JOIN ".DB_PREFIX."product_option_image_value poiv ON(poi.product_option_image_id = poiv.product_option_image_id) WHERE poi.product_id = ''".(int)$product_id."'' ORDER BY poi.sort_order ASC")->rows;\r\n	}\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n</modification>', 1, '2017-10-02 01:33:46'),
(3, 'Subcategory Products in Parent Category', 'subcategory-products-in-parent-category.1.0.1-1', 'Neotrendy', '1.0.1-1', 'http://bit.ly/2e7ZA7P', '<?xml version="1.0" encoding="UTF-8"?>\n<modification>\n	<name>Subcategory Products in Parent Category</name>\n	<version>1.0.1-1</version>\n    <author>Neotrendy</author>\n    <link>http://bit.ly/2e7ZA7P</link>\n    <code>subcategory-products-in-parent-category.1.0.1-1</code>\n	\n	<!--\n	Changelog:\n	version 1.0.1-1 - with Refine Search enabled\n	\n	Author: Ing. Martin Trubíni, Neotrendy, opencart@hypertext.sk\n	Documentation: http://www.opencart.com/index.php?route=extension/extension/info&extension_id=18722\n	-->\n\n	<file path="catalog/controller/product/category.php">\n		<operation>\n			<search><![CDATA[''filter_category_id'' => $category_id,]]></search>\n			<add position="after"><![CDATA[				''filter_sub_category'' => true,]]></add>\n		</operation>\n	</file>\n\n	<file path="catalog/controller/extension/module/category.php">\n		<operation>\n			<search><![CDATA[$categories = $this->model_catalog_category->getCategories(0);]]></search>\n			<add position="replace" offset="30"><![CDATA[\n		if (isset($parts[2])) {\n			$data[''subchild_id''] = $parts[2];\n		} else {\n			$data[''subchild_id''] = 0;\n		}\n		\n		$categories_1 = $this->model_catalog_category->getCategories(0);\n\n		foreach ($categories_1 as $category_1) {\n			$level_2_data = array();\n\n			if ($category_1[''category_id''] == $data[''category_id'']) {\n				$categories_2 = $this->model_catalog_category->getCategories($category_1[''category_id'']);\n\n				foreach($categories_2 as $category_2) {\n					$filter_2_data = array(''filter_category_id'' => $category_2[''category_id''], ''filter_sub_category'' => true);\n					\n					$level_3_data = array();\n					$categories_3 = $this->model_catalog_category->getCategories($category_2[''category_id'']);\n					\n					foreach($categories_3 as $category_3) {\n						$filter_3_data = array(''filter_category_id'' => $category_3[''category_id''], ''filter_sub_category'' => true);\n\n						$level_3_data[] = array(\n							''category_id'' => $category_3[''category_id''],\n							''name'' => $category_3[''name''] . ($this->config->get(''config_product_count'') ? '' ('' . $this->model_catalog_product->getTotalProducts($filter_3_data) . '')'' : ''''),\n							''href'' => $this->url->link(''product/category'', ''path='' . $category_1[''category_id''] . ''_'' . $category_2[''category_id''] . ''_'' . $category_3[''category_id''])\n						);\n					}\n\n					$level_2_data[] = array(\n						''category_id'' => $category_2[''category_id''],\n						''name'' => $category_2[''name''] . ($this->config->get(''config_product_count'') ? '' ('' . $this->model_catalog_product->getTotalProducts($filter_2_data) . '')'' : ''''),\n						''children'' => $level_3_data,\n						''href'' => $this->url->link(''product/category'', ''path='' . $category_1[''category_id''] . ''_'' . $category_2[''category_id''])\n					);\n				}\n			}\n\n			$filter_1_data = array(\n				''filter_category_id''  => $category_1[''category_id''],\n				''filter_sub_category'' => true\n			);\n\n			$data[''categories''][] = array(\n				''category_id'' => $category_1[''category_id''],\n				''name''        => $category_1[''name''] . ($this->config->get(''config_product_count'') ? '' ('' . $this->model_catalog_product->getTotalProducts($filter_1_data) . '')'' : ''''),\n				''children''    => $level_2_data,\n				''href''        => $this->url->link(''product/category'', ''path='' . $category_1[''category_id''])\n			);\n		}\n		]]></add>\n		</operation>\n	</file>\n\n	<file path="catalog/view/theme/*/template/extension/module/category.tpl">\n		<operation>\n			<search><![CDATA[<div class="list-group">]]></search>\n			<add position="replace" offset="17"><![CDATA[\n<div class="list-group">\n  <?php foreach ($categories as $category_1) { ?>\n  <?php if ($category_1[''category_id''] == $category_id) { ?>\n  <a href="<?php echo $category_1[''href'']; ?>" class="list-group-item active"><?php echo $category_1[''name'']; ?></a>\n  <?php if ($category_1[''children'']) { ?>\n  <?php foreach ($category_1[''children''] as $category_2) { ?>\n  <?php if ($category_2[''category_id''] == $child_id) { ?>\n  <a href="<?php echo $category_2[''href'']; ?>" class="list-group-item active">&nbsp;&nbsp;&nbsp;- <?php echo $category_2[''name'']; ?></a>\n  <?php if ($category_2[''children'']) { ?>\n    <?php foreach ($category_2[''children''] as $category_3) { ?>\n	<?php if ($category_3[''category_id''] == $subchild_id) { ?>\n    <a href="<?php echo $category_3[''href'']; ?>" class="list-group-item active">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- <?php echo $category_3[''name'']; ?></a>\n	<?php } else { ?>\n	<a href="<?php echo $category_3[''href'']; ?>" class="list-group-item">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- <?php echo $category_3[''name'']; ?></a>\n	<?php } ?>\n    <?php } ?>\n  <?php } ?>\n  <?php } else { ?>\n  <a href="<?php echo $category_2[''href'']; ?>" class="list-group-item">&nbsp;&nbsp;&nbsp;- <?php echo $category_2[''name'']; ?></a>\n  <?php } ?>\n  <?php } ?>\n  <?php } ?>\n  <?php } else { ?>\n  <a href="<?php echo $category_1[''href'']; ?>" class="list-group-item"><?php echo $category_1[''name'']; ?></a>\n  <?php } ?>\n  <?php } ?>\n</div>\n		]]></add>\n		</operation>\n	</file>\n\n	<!--<file path="catalog/view/theme/*/template/product/category.tpl">\n		<operation>\n			<search><![CDATA[<?php if ($categories) { ?>]]></search>\n			<add position="replace" offset="25"><![CDATA[]]></add>\n		</operation>\n	</file>-->\n\n</modification>', 0, '2017-10-29 05:30:38');
