INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(98, 2, 'سلة أوراق 7 لتر كروم  ', '&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; width=&quot;638&quot; style=&quot;width: 478pt;&quot;&gt;&lt;tbody&gt;&lt;tr height=&quot;66&quot; style=&quot;mso-height-source:userset;height:50.1pt&quot;&gt;\r\n  &lt;td height=&quot;66&quot; class=&quot;xl80&quot; dir=&quot;RTL&quot; width=&quot;638&quot; style=&quot;height:50.1pt;width:478pt&quot;&gt;سلة\r\n  أوراق 7 لتر ذات النموذج الأساسي والكلاسيكي المناسب للغرفة النوم أو غرفة\r\n  المعيشة أو مكتبك الشخصي &lt;br&gt;\r\n    ذات جسم مقاوم لتاكل سهلة تنظيف والحمل ذات جودة عالية مصنوعة من البولي\r\n  الكروم&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;', '', 'سلة أوراق 7 لتر كروم  ', '', ''),
(95, 1, 'Pedal Bin 3Liter-Plastic Bucket -Brilliant Steel', '&lt;p&gt;&quot;Pedal Pin with a Solid metal lid - odour-proof and silent&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Strong plastic inner bucket - removable and easy to clean&lt;/p&gt;&lt;p&gt;&amp;nbsp;Robust pedal mechanism and high quality materials - corrosion resistant&lt;/p&gt;&lt;p&gt;Non-skid base - pedal bin stands stable, even on wet or polished floors&lt;/p&gt;&lt;p&gt;Plastic floor ring - less chance of damage to the floor&lt;/p&gt;&lt;p&gt;Height with open lid: 420mm&lt;/p&gt;&lt;p&gt;10 years Guarantee&quot;&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 'Pedal Bin 3Liter-Plastic Bucket -Brilliant Steel', '', ''),
(95, 2, 'حاوية قمامة 3 لتر مع سطل بلاستيك - كروم ', '&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; width=&quot;638&quot; style=&quot;width: 478pt;&quot;&gt;&lt;tbody&gt;&lt;tr height=&quot;102&quot; style=&quot;mso-height-source:userset;height:76.8pt&quot;&gt;\r\n  &lt;td height=&quot;102&quot; class=&quot;xl76&quot; dir=&quot;RTL&quot; width=&quot;638&quot; style=&quot;height:76.8pt;width:478pt&quot;&gt;&lt;br&gt;\r\n    حاوية قمامة انيقة 3 لتر مع سطل بلاستيك&amp;nbsp;\r\n  بدلو داخلي بلاستيكي ذات جودة عالية من شركة برابنتيا الايطاليه&lt;br&gt;\r\n    تحتوي على دلو من البلاستيك داخلي&lt;br&gt;\r\n    بغطاء معدني صلب - مقاوم للرائحة وصامتة عند الفتح والغلق&lt;br&gt;\r\n    دلو قوي من البلاستيك الداخلي - قابلة للإزالة وسهلة التنظيف&lt;br&gt;\r\n    آلية دواسة قوية ومواد ذات جودة عالية - مقاومة للتآكل&lt;br&gt;\r\n    قاعدة عدم الانزلاق - قاعدة دواسة تقف مستقرة، حتى على الأرضيات الرطبة أو\r\n  المصقول&lt;br&gt;\r\n    حلقة أرضية من البلاستيك - فرصة أقل للتلف بالأرضيات&lt;br&gt;\r\n    الارتفاع مع غطاء مفتوح: 420mm&lt;br&gt;\r\n    ضمان 10 سنوات من شركة بارابنتيا الايطالية&amp;nbsp;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;', '', 'حاوية قمامة 3 لتر مع سطل بلاستيك - كروم ', '', ''),
(96, 1, 'Touch Bin 3Liter. Plstc Bkt -Brillant Steel', '&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; width=&quot;284&quot; style=&quot;width: 213pt;&quot;&gt;&lt;tbody&gt;&lt;tr height=&quot;66&quot; style=&quot;mso-height-source:userset;height:50.1pt&quot;&gt;\r\n  &lt;td height=&quot;66&quot; class=&quot;xl78&quot; width=&quot;284&quot; style=&quot;height:50.1pt;width:213pt&quot;&gt;Complete\r\n  with stainless steel wall bracket - easy to fix to the wall&lt;br&gt;\r\n    Strong plastic inner bucket - easy to clean&lt;br&gt;\r\n    Easy to take off the wall bracket - for thorough cleaning&lt;br&gt;\r\n    Matching Brabantia bin liners available with tie-tape (size A) - perfect\r\n  fit and no ugly over wrap&lt;br&gt;\r\n    Protective rim - prevents damage to the surface&lt;br&gt;\r\n    Brabantia guarantee &lt;br&gt;\r\n    10&amp;nbsp;Year&lt;br&gt;\r\n    Article Number&lt;br&gt;\r\n    363962&lt;br&gt;\r\n    Dimensions&lt;br&gt;\r\n    Capacity 3 Litres&lt;br&gt;\r\n    Diameter 18.0 cm&lt;br&gt;\r\n    Height 28.0 cm&lt;br&gt;\r\n    Width 18.0 cm&lt;br&gt;\r\n    Depth 18.4 cm&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;', '', 'Touch Bin 3Liter. Plstc Bkt -Brillant Steel', '', ''),
(96, 2, 'حاوية قمامة  لمس 3 لتر كروم ', '&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; width=&quot;638&quot; style=&quot;width: 478pt;&quot;&gt;&lt;tbody&gt;&lt;tr height=&quot;66&quot; style=&quot;mso-height-source:userset;height:50.1pt&quot;&gt;\r\n  &lt;td height=&quot;66&quot; class=&quot;xl79&quot; dir=&quot;RTL&quot; width=&quot;638&quot; style=&quot;height:50.1pt;width:478pt&quot;&gt;حاوية\r\n  قمامة&amp;nbsp; لمس انيقه سعة 3 لترمصنوعة\r\n  بالكامل من الستايلس ستيل يمكن فتحها بسهوله لتنظيف &lt;br&gt;\r\n    ذات ذراع يمكن ان تثبت على الحائط &lt;br&gt;\r\n    ضمان 10 سنوات من شركة بارابنتيا الايطالية&amp;nbsp;&lt;br&gt;\r\n    &lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;', '', 'حاوية قمامة  لمس 3 لتر كروم ', '', ''),
(98, 1, 'Waste Paper Bin 7Lt -Brilliant Steel', '&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; width=&quot;284&quot; style=&quot;width: 213pt;&quot;&gt;&lt;tbody&gt;&lt;tr height=&quot;66&quot; style=&quot;mso-height-source:userset;height:50.1pt&quot;&gt;\r\n  &lt;td height=&quot;66&quot; class=&quot;xl79&quot; width=&quot;284&quot; style=&quot;height:50.1pt;width:213pt&quot;&gt;Basic\r\n  model for use in the bedroom, living area or your office&lt;br&gt;\r\n    Corrosion resistant&lt;br&gt;\r\n    Easy to clean&lt;br&gt;\r\n    Body made of high-grade poly chrome or steel plate with Galfan coating&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;', '', 'Waste Paper Bin 7Lt -Brilliant Steel', '', ''),
(97, 2, 'حاوية قمامة لمس 30 لتر أزرق كوبالت ', '&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; width=&quot;638&quot; style=&quot;width: 478pt;&quot;&gt;&lt;tbody&gt;&lt;tr height=&quot;66&quot; style=&quot;mso-height-source:userset;height:50.1pt&quot;&gt;\r\n  &lt;td height=&quot;66&quot; class=&quot;xl80&quot; dir=&quot;RTL&quot; width=&quot;638&quot; style=&quot;height:50.1pt;width:478pt&quot;&gt;حاوية\r\n  قمامة لمس 30 لتر ''لينة اللمس عند الفتح والإغلاق - عملية وسهلة وخفيفة&lt;br&gt;\r\n    تصميم المفصلي فريد - غطاء يفتح بصمت&lt;br&gt;\r\n    قابل للإزالة غطاء الفولاذ المقاوم للصدأ &lt;br&gt;\r\n    دلو البلاستك قابل للازالة سهل التنظيف&lt;br&gt;\r\n    فتحات التهوية الخاصة في دلو الداخلية تسمح للهواء الزائد للهروب عند وضع\r\n  اكياس القمامة ويمنع فراغ - من السهل دائما لتغيير&lt;br&gt;\r\n    مقبض حامل قوي - يجعل اللمس سهلة للتحرك حتى عندما الكامل&lt;br&gt;\r\n    مطابقة لمواصفات برابانتيا الايطاليه &lt;br&gt;\r\n    حافة واقية من البلاستيك - يمنع الأضرار التي لحقت الأرض&lt;br&gt;\r\n    مصنوعة من مواد مقاومة للتآكل - دائمة وسهلة التنظيف&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;', '', 'حاوية قمامة لمس 30 لتر أزرق كوبالت ', '', ''),
(97, 1, 'Touch Bin 30Liter -Cobalt Blue #481024', '&lt;table border=&quot;0&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; width=&quot;284&quot; style=&quot;width: 213pt;&quot;&gt;&lt;tbody&gt;&lt;tr height=&quot;66&quot; style=&quot;mso-height-source:userset;height:50.1pt&quot;&gt;\r\n  &lt;td height=&quot;66&quot; class=&quot;xl79&quot; width=&quot;284&quot; style=&quot;height:50.1pt;width:213pt&quot;&gt;Soft-Touch''\r\n  opening and closing system - easy and light operation&lt;br&gt;\r\n    Unique hinge design - lid opens silently&lt;br&gt;\r\n    Removable stainless steel lid unit - bin liner easy to change&lt;br&gt;\r\n    Removable plastic inner bucket - easy to clean&lt;br&gt;\r\n    Special ventilation holes in inner bucket allow excess air to escape when\r\n  you insert the bin liner and prevents vacuum - always easy to change&lt;br&gt;\r\n    Sturdy carrying handle - makes Touch Bin easy to move even when full&lt;br&gt;\r\n    Matching Brabantia bin liners available with tie-tape (size G) - perfect\r\n  fit and no ugly over wrap&lt;br&gt;\r\n    Plastic protective rim - prevents damage to the floor&lt;br&gt;\r\n    Made of corrosion-resistant materials - durable and easy to clean&lt;br&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;', '', 'Touch Bin 30Liter -Cobalt Blue #481024', '', '');
